import React from 'react';
import './App.css';

import { Query} from 'react-apollo';
import { GET_ALL_RECIPES } from '../queries';


const App = () => (
  <div className="App">
      <h1> RS Company</h1>

      <Query query={GET_ALL_RECIPES}>
          { () => {
            return(
              <p>Recipes</p>
            )
          }}
      </Query>

  </div>
)

export default App;
